2023	2192	faq	30bd37a4-a5cb-4f84-954c-c115981a7aff	{"delivery_title":"Доставка","delivery_content":"<p>Мы осуществляем доставку по Самаре и пригородным районам. Заказы принимаем с 9:00 до 23:00, а доставляем круглосуточно. Заказы можно забрать самовывозом в одном из салонов в Самаре.</p>","delivery_additional":[{"title":"Салоны в Самаре","content":"<p>Самара, Проспект Кирова, 22 (БЦ Бигбен)</p>\\n<p>Самара, Улица Ленина, 15, ТЦ \\"Аврора\\", офис 21</p>\\n<p>Самара, Площадь Славы, 5</p>"},{"title":"Время работы","content":"<p>Время работы салонов: ежедневно, c 09:00 до 23:00</p>\\n<p>Принимаем заказы: c 09:00 до 23:00</p>\\n<p>Доставка заказов: круглосуточно</p>"},{"title":"Условия доставки","content":"<p><strong>9:00 - 21:00</strong></p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 1500₽;</li>\\n<li>Если стоимость заказа менее 1500₽, то стоимость доставки 300₽.</li>\\n</ul>\\n<p><strong>21:00 - 9:00</strong></p>\\n<ul>\\n<li>C 23:00 до 9:00 стоимость доставки 500₽ и не зависит от стоимости букета.</li>\\n</ul>"}],"delivery_footnote":"Более подробную информацию по возможности и стоимости доставки уточняйте у менеджера компании Арабеска по телефону +7 (812) 200-50-76","delivery_advant_title":"Наши преимущества","delivery_advant_subtitle":"Вы можете выбрать интересующие опции при оформления заказа.","delivery_advant_cards":[{"title":"Анонимная доставка","content":"<p>Сохраните сюрприз до последнего момента с анонимной доставкой цветов. Напишите об этом в поле для комментария при оформлении заказа.</p>"},{"title":"Если не знаете адрес получателя","content":"<p>Доставим заказ по номеру телефона получателя &mdash; мы созвонимся с получателем букета, выясним удобное время и адрес доставки. По телефону сохраним сюрприз, можем представиться курьерской службой.</p>"},{"title":"Доставка к указанному времени","content":"<p>Вы можете заказать цветы у нас и быть уверенными в доставке ровно к указанному времени, чтобы порадовать своих любимых.</p>"},{"title":"Встреча в аэропорту или на вокзале","content":"<p>Мы доставим свежие цветы сразу в руки, чтобы порадовать и оживить эмоции после путешествия.</p>"},{"title":"SMS-уведомления","content":"<p>Мы доставим свежие цветы сразу в руки, чтобы порадовать и оживить эмоции после путешествия.</p>"}],"additional_blocks":[{"title":"Условия возврата","cintent":"<p>В случае отсутствия получателя по адресу доставки или его отказа от получения букета, мы готовы доставить цветы по другому адресу. Данные предложение касается только монобукетов. Если получатель не смог принять букет по указанному адресу, мы вернём стоимость заказа за вычетом услуг курьерской службы. Мы также можем оформить повторную доставку. Сборные композиции можно будет доставить повторно в течение 24-х часов по новому адресу в черте города с повторной оплатой доставки.</p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 1500 ₽;</li>\\n<li>Если стоимость заказа менее 1500 ₽, то стоимость доставки 300 ₽.</li>\\n</ul>\\n<ol>\\n<li>Всегда делайте срез над сочленнением стебля;</li>\\n<li>Нож обязательно должен быть чистым;</li>\\n<li>Никогда не подрезайте стебли ножницами &mdash; это сминает сосуды.</li>\\n</ol>\\n<p>Более подробную информацию по возможности и стоимости доставки уточняйте у менеджера компании LINKO по телефону&nbsp;<a href=\\"http://localhost:3000/faq\\">+7 (812) 200-50-76</a></p>"},{"title":"Тест","cintent":"<p>В случае отсутствия получателя по адресу доставки или его отказа от получения букета, мы готовы доставить цветы по другому адресу. Данные предложение касается только монобукетов. Если получатель не смог принять букет по указанному адресу, мы вернём стоимость заказа за вычетом услуг курьерской службы. Мы также можем оформить повторную доставку. Сборные композиции можно будет доставить повторно в течение 24-х часов по новому адресу в черте города с повторной оплатой доставки.</p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 150