3286	3507	products	11	{"title":"Подписка S","price":7500,"description":"<h3>Цветочная подписка - это удобно и выгодно</h3>\\n<ul>\\n<li>Вам больше не нужно заботиться о поиске цветов каждую неделю. Вы оформляете подписку один раз и наслаждаетесь цветами целый месяц.</li>\\n<li>Мы согласовываем с вами дату, время и адрес всех доставок сразу или перед каждой доставкой отдельно. Доставка по Самаре бесплатная.</li>\\n<li>4 недели - 4 новых букета. В составе возможны замены цветов на сезонные с сохранением стиля, объема и цветовой гаммы букета.</li>\\n<li>При первом заказе вы получаете в подарок вазу и инструкцию по уходу за букетом.</li>\\n</ul>\\n<h3>Идеальный букет для вашего дома</h3>\\n<ul>\\n<li>Мы можем подготовить для вас букет с индивидуальным составом или произвести необходимые замены, чтобы букет прекрасно подходил под ваш интерьер.</li>\\n</ul>\\n<h3>Подарок для себя или близкого человека</h3>\\n<ul>\\n<li>Создайте уют и красоту в своем доме: каждую неделю вам будет приезжать свежий, лаконичный букет, не похожий на предыдущий.</li>\\n<li>Оформите сертификат на цветочную подписку в подарок для близкого человека и подарите приятные эмоции на целый месяц.</li>\\n</ul>","category":{"create":[{"products_id":"+","categories_id":{"id":"344d9c23-aa2f-4add-97b5-1eeed261978a"}}],"update":[],"delete":[]},"images":{"create":[{"products_id":"+","directus_files_id":{"id":"5a362d69-eb65-428e-a76b-9adecb6688bf"}},{"products_id":"+","directus_files_id":{"id":"10c66aa3-f475-4802-ba10-bc958fc5d3ad"}},{"products_id":"+","directus_files_id":{"id":"e5c54d95-3ce1-48b7-b92a-7ba8fb11486e"}},{"products_id":"+","directus_files_id":{"id":"11d0e306-e29b-4ee7-a1d4-ad5895f49481"}}],"update":[],"delete":[]}}	{"title":"Подписка S","price":7500,"description":"<h3>Цветочная подписка - это удобно и выгодно</h3>\\n<ul>\\n<li>Вам больше не нужно заботиться о поиске цветов каждую неделю. Вы оформляете подписку один раз и наслаждаетесь цветами целый месяц.</li>\\n<li>Мы согласовываем с вами дату, в