3860	4133	settings	67e2da19-c932-4da8-bcdd-978895c82ef7	{"id":"67e2da19-c932-4da8-bcdd-978895c82ef7","date_created":"2025-11-07T08:16:36.986Z","date_updated":"2025-12-11T12:39:43.646Z","products_info":[{"title":"Уход за цветами","content":"<p>В случае отсутствия получателя по адресу доставки или его отказа от получения букета, мы готовы доставить цветы по другому адресу. Данные предложение касается только монобукетов. Если получатель не смог принять букет по указанному адресу, мы вернём стоимость заказа за вычетом услуг курьерской службы. Мы также можем оформить повторную доставку. Сборные композиции можно будет доставить повторно в течение 24-х часов по новому адресу в черте города с повторной оплатой доставки.</p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 1500 ₽;</li>\\n<li>Если стоимость заказа менее 1500 ₽, то стоимость доставки 300 ₽.</li>\\n</ul>\\n<ol>\\n<li>Всегда делайте срез над сочленнением стебля;</li>\\n<li>Нож обязательно должен быть чистым;</li>\\n<li>Никогда не подрезайте стебли ножницами &mdash; это сминает сосуды.</li>\\n</ol>\\n<p>Более подробную информацию по возможности и стоимости доставки уточняйте у менеджера компании LINKO по телефону&nbsp;<a href=\\"http://localhost:3000/product-10\\">+7 (812) 200-50-76</a></p>"},{"title":"Доставка","content":"<p>В случае отсутствия получателя по адресу доставки или его отказа от получения букета, мы готовы доставить цветы по другому адресу. Данные предложение касается только монобукетов. Если получатель не смог принять букет по указанному адресу, мы вернём стоимость заказа за вычетом услуг курьерской службы. Мы также можем оформить повторную доставку. Сборные композиции можно будет доставить повторно в течение 24-х часов по новому адресу в черте города с повторной оплатой доставки.</p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 1500 ₽;</li>\\n<li>Если стоимость заказа менее 1500 ₽, то стоимость доставки 300 ₽.</li>\\n</ul>\\n<ol>\\n<li>Всегда делайте срез над сочленнением стебля;</li>\\n<li>Нож обязательно должен быть чистым;</li>\\n<li>Никогда не подрезайте стебли ножницами &mdash; это сминает сосуды.</li>\\n</ol>\\n<p>Более подробную информацию по возможности и стоимости доставки уточняйте у менеджера компании LINKO по телефону&nbsp;<a href=\\"http://localhost:3000/product-10\\">+7 (812) 200-50-76</a></p>"},{"title":"Правила возврата","content":"<p>В случае отсутствия получателя по адресу доставки или его отказа от получения букета, мы готовы доставить цветы по другому адресу. Данные предложение касается только монобукетов. Если получатель не смог принять букет по указанному адресу, мы вернём стоимость заказа за вычетом услуг курьерской службы. Мы также можем оформить повторную доставку. Сборные композиции можно будет доставить повторно в течение 24-х часов по новому адресу в черте города с повторной оплатой доставки.</p>\\n<ul>\\n<li>С 9:00 - 21:00 доставим цветы по Самаре бесплатно при заказе от 1500 ₽;</li>\\n<li>Если стоимость заказа менее 1500 ₽, то стоимость доставки 300 ₽.</li>\\n</ul>\\n<ol>\\n<li>Всегда делайте срез над сочленнением стебля;</li>\\n<li>Нож обязательно должен быть чистым;</li>\\n<li>Никогда не подрезайте стебли ножницами &mdash; это сминает сосуды.</li>\\n</ol>\\n<p>Более подробную информацию по возможности и стоимости доставки уточняйте у менеджера компании LINKO по телефону&nbsp;<a href=\\"http://localhost:3000/product-10\\">+7 (812) 200-50-76</a></p>"}],"subscription_category":"344d9c23-aa2f-4add-97b5-1eeed261978a","delivery_price":350,"delivery_disable_price":2500,"disable_controls":[1,2,3,4]}	{"delivery_price":350,"date_updated":"2025-12-11T12:39:43.646Z"}	\N	\N
