180f444b-b892-463a-b309-56df5088f9ab	2025-11-03 21:34:35.749+00	\N	c49375f7-06d0-47d3-babd-0515605ec99f	Цветочная подписка	Красота свежих цветов каждую неделю!	["4 тарифа на выбор","Бесплатная доставка","Ваза в подарок","Подарочный сертификат"]	Букет для подарка в нашей цветочной подписке — это букет, собранный точно в соответствии с вашими пожеланиями, с заданными Вами параметрами доставки и приятной скидкой.	\N	\N	Вам больше не нужно заботиться о поиске цветов каждую неделю. Вы оформляете подписку один раз и наслаждаетесь цветами целый месяц.	Что вы получаете с подпиской?	<p>Это самые часто задаваемые вопросы и ответы на них. Если ты не нашел свой вопрос - напиши нам на почту:&nbsp;<a href="mailto:info@intheplace.ru">info@intheplace.ru</a></p>	[{"title":"Как я могу присоединиться к бонусной программе?","content":"<p>Мы узнаем все важные детали: какие букеты вам нравятся, какая упаковка, какая цветовая гамма. Какую задачу решают букеты: оправляем одному человеку с учетом его вкусов, или разным под каждый важный для вас повод.</p>"},{"title":"Lorem","content":"<p>Мы узнаем все важные детали: какие букеты вам нравятся, какая упаковка, какая цветовая гамма. Какую задачу решают букеты: оправляем одному человеку с учетом его вкусов, или разным под каждый важный для вас повод.</p>"},{"title":"Lorem ipsum","content":"<p>Мы узнаем все важные детали: какие букеты вам нравятся, какая упаковка, какая цветовая гамма. Какую задачу решают букеты: оправляем одному человеку с учетом его вкусов, или разным под каждый важный для вас повод.</p>"}]	Остались вопросы?	09be7688-d281-480b-9a0d-f7966781057a	<p>Напишите нам в официальный профиль в telegram или whatsapp. Отвечаем в течение 24 часов</p>	[{"title":"Мы в Telegram","link":"https://example.com"},{"title":"Мы в Whatsapp","link":"https://example.com"}]
